import Step from "./Step"

function Steps() {
  return (
    <div className="bg-oval w-[274px] h-[568px] rounded-[10px] absolute left-[16px] top-[16px] py-[40px] px-[32px]">
     <Step step="step 2" page="YOUR INFO"/>
     <Step step="step 3" page="SELECT PLAN"/>
     <Step step="step 4" page="ADD-ONS"/>
     <Step step="step 1" page=""/>
    </div>
  )
}

export default Steps
